import { useSelector } from 'react-redux'


export function Chat(){
    const activeChat = useSelector(state => state.chatModule )
    return <div className="chat">
        {(activeChat.chatId &&
            <div className='chatHeader'>{activeChat.chatName}</div>
        )}
    </div>
}
